import Sidebar from './Sidebar';
import React, { useState, useEffect } from 'react';
import { Box, TextField, Typography, List, ListItem, ListItemText, Pagination } from '@mui/material';


const ListRegis = () => {
  useEffect(() => {
    const fetchEvents = async () => {
      try {
        const eventResponse = await axios.get('http://127.0.0.1:8000/api/events/');
        setEvents(eventResponse.data);
      } catch (error) {
        console.error('Error fetching events:', error);
      }
    };

    const fetchRegistrations = async () => {
      try {
        const registrationResponse = await axios.get('http://127.0.0.1:8000/api/registers/');
        setRegistrations(registrationResponse.data);
      } catch (error) {
        console.error('Error fetching registrations:', error);
      }
    };

    fetchEvents();
    fetchRegistrations();
  }, []);

  return (
    <Box sx={{ display: 'flex', padding: 2 }}>
    {/* Sidebar */}
    <Sidebar />

    {/* Main content */}
    <Box sx={{ flex: 1, marginLeft: 2 }}>
      <Typography >
        รายชื่อคนลงทะเบียน
      </Typography>
      
      <Box sx={{ marginY: 2 }}>
        <TextField
          fullWidth
          variant="outlined"
          placeholder="ค้นหา..."
      
         
        />
      </Box>



      <Box sx={{ display: 'flex', justifyContent: 'center', marginTop: 2 }}>
        <Pagination

 

          variant="outlined"
          shape="rounded"
        />
      </Box>
    </Box>
  </Box>
);
};

export default ListRegis;
